// api/tmdb.js
import axios from 'axios';

const API_KEY = 'your_actual_api_key_here';

const tmdb = axios.create({
  baseURL: 'https://api.themoviedb.org/3',
  params: {
    api_key: d0d79eb2a003c31938434d703d0cfc10,
  },
});

export default tmdb;
